import React from "react";
import { Table } from "react-bootstrap";
import { connect } from "react-redux";

function Cart() {
  return (
    <div>
      <div>
        <Table responsive="md">
          <thead>
            <tr>
              <th>#</th>
              <th>상품명</th>
              <th>수량</th>
              <th>변경</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>{}</td>
              <td>Table cell</td>
              <td>Table cell</td>
            </tr>
          </tbody>
        </Table>
      </div>
    </div>
  );
}

function propsChange(state) {
  return {
    state: state,
  };
}

export default connect(propsChange)(Cart);

// export default Cart;
